class Solution:
    def maximumValueSum(self, board: List[List[int]]) -> int:
        n = len(board)
        m = len(board[0])
        res = [[] for i in range(n)]
        for i in range(n) :
            for j in range(m) :
                res[i].append([board[i][j], j])
            res[i].sort(key = lambda x : -x[0])
            res[i] = res[i][ : 3]
        ans = -float('inf')
        for i in range(n) :
            for p in range(3) :
                for j in range(i + 1, n) :
                    # if (i == j) :
                    #     continue
                    for l in range(3) :
                        if (res[i][p][1] != res[j][l][1]) :
                            for k in range(j + 1, n) :
                                # if (k == j or k == i) :
                                #     continue
                                for o in range(3) :
                                    if (res[k][o][1] != res[i][p][1] and res[k][o][1] != res[j][l][1]) :
                                        # print(res[i][o], res[j][l], res[k][o])
                                        ans = max(ans, res[i][p][0] + res[j][l][0] + res[k][o][0])
        return ans
